INSERT INTO public.uloga (uloga_id, vrsta_uloge, opis) VALUES (1, 'administrator', 'Pregledava/kreira/ažurira kategorije cesta (Autocesta, Državna cesta, ...) i dodjeljuje moderatore. Može napraviti sigurnosnu kopiju (eng. backup) svih dionica cestai popisa dokumenataiz baze u obliku SQL skripte. Ne radi se sigurnosna kopija datoteka. Može vratiti podatke iz sigurnosne kopije pri čemu se brišu trenutni podaci u bazi. Za svaku dionicu ceste automatski se provjerava da li postoje fizičke datoteke dokumenatakoje su postavljene  od  strane prometnika i ako ne šalje se zahtjev na e-mail prometniku da se ponovo postave. Vidi statistiku korištenja sustava pristupa stranicama (min 5), uz mogućnost filtriranja po korisnicima i vremenskom razdoblju (od – do).');
INSERT INTO public.uloga (uloga_id, vrsta_uloge, opis) VALUES (2, 'moderator', 'Pregledava/kreira/ažurira dionice cesta za kategorije cesta za koje je zadužen. Kod kreiranja mora odabrati kategoriju ceste i unijeti oznaku(DC3), naziv početka dionice(Varaždin), naziv završetka dionice (Čakovec) i broj kilometara. Može vidjeti popis problemai otvoriti/zatvoriti dionicu ceste za daljnje prometovanje. Vidi popis dokumenata te potvrđuje/odbija dokumente za dionicu  ceste koje  je  postavio prometnik. Posebno su označeni dokumenti dionice cesta koji nisu potvrđeni ili odbijeni.');
INSERT INTO public.uloga (uloga_id, vrsta_uloge, opis) VALUES (3, 'prometnik', 'Može evidentirati obilazak odabirom dionice ceste koja je otvorena i prijaviti problem na cesti. Prijava se sastoji od naziva, opisa, datuma i vremena. Vidi popis svih svojih obilazaka s ukupnim brojem prijeđenih kilometara. Može postavljati dokumente za dionicu ceste pri čemu bira vrstu dokumenta(slika, video, audio, ...). Vidi  galeriju potvrđenih dokumenata. Može filtrirati po vrsti dokumenta i definirati koliko dokumenata se prikazuje po stranici.');
INSERT INTO public.uloga (uloga_id, vrsta_uloge, opis) VALUES (4, 'neregistrirani korisnik', 'Vidi popis svih dionica cesta (oznaka, početna i završna dionica) grupirano po kategorijama. Može pretraživati dionice ceste unosom polazišta i odredišta čime dobiva popis dostupnih dionica ceste s brojem kilometara. Putem RSS kanala može se pratiti zatvorene dionice ceste po svakoj kategoriji ceste.');


